import {GET_ERRORS} from '../constants'
import axios from 'axios'

const registerUser = (userData, history) => dispatch => {
    axios.post('hht[p://localhost:5000/api/users/register', userData)
        .then(res => history.push('/login'))
        .catch(err =>dispatch({
            type: GET_ERRORS,
            payload: err.data
        }))
}
